const HyperLinks = () => {
    return (
        <div className="border border-black p-4 flex justify-between">
            <a className="px-2 flex flex-col justify-center">Home</a>
            <a className="px-2 flex flex-col justify-center">Reports</a>
            <a className="px-2 flex flex-col justify-center">About Me</a>
        </div>
    )
}

export default HyperLinks;
